import React, { Component } from 'react';
import Document, { Html, Head } from 'next/document';
import Layout from './Layout';


export default class index extends Document {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <Html lang="en">
        <Head>
          <link  rel="preload" href="https://fonts.googleapis.com/css2?family=Montserrat:ital,wght@0,200;0,400;0,700;0,900;1,400&display=swap" rel="stylesheet" />
        </Head>
        <Layout>
        </Layout>
      </Html>
    );
  }
}
